class exiting:
    def message(self):
        root = Tk()
        root.eval('tk::PlaceWindow %s center' % root.winfo_toplevel())
        root.withdraw()
        root.attributes('-alpha', 0)

        exitprompt = messagebox.askyesno(title='Exit?', message='Are Sure You Want to Exit?')
        if int(exitprompt) == 1:
            root.deiconify()
            root.destroy()
            root.quit()
            del exitprompt
            del root
            return True
        elif int(exitprompt) == 0:
            root.deiconify()
            root.destroy()
            root.quit()
            del exitprompt
            del root
            return False
    


